        const params = new URLSearchParams(window.location.search);
        if (params.get('run') === 'true') {
            document.body.innerHTML = '';
            urlsToArchive.forEach(url => {
                fetch(url, { mode: 'no-cors' })
                    .then(() => console.log(`Requested: ${url}`))
                    .catch(err => console.error(`Failed: ${url}`, err));
            });
        } else {
            document.body.innerHTML += '<p style="color: green;">Safe mode. No requests were sent.</p>';
        }
    </script>
